            title: "movie",
            description: "something",
            image: image,

        },
        {
            title: "movie",
            description: "something",
            image: image,

        },
    ];
    return (
        <section className="project" id="skills">
            <Container>
                <Row>
                    <Col size={8}>
                        <div>
                            <Row className="project-title">
                                <img src={BannerCat} style={{ width: 100, height: 100, objectFit: 'container' }} />
                                <h2> Projects</h2>
                            </Row>
                            <p>something to introduct something</p>

                            <Tab.Container id="projects-tabs" defaultActiveKey="tech">
                                <Nav variant="pills" className="nav-pills mb-5 justify-center" id="">
                                    <Nav.Item>
                                        <Nav.Link eventKey="tech">Tech Skills</Nav.Link>
                                    </Nav.Item>
                                    <Nav.Item>
                                        <Nav.Link eventKey="soft">Soft Skills</Nav.Link>
                                    </Nav.Item>
                                </Nav>
                                <Col>
                                    <Tab.Content>
                                        <Tab.Pane eventKey="tech">
                                            <Row>
                                                {
                                                    projects.map((project, index) => {
                                                        return (
                                                            <ProjectCard key={index}
                                                                {...project}
                                                            />
                                                        );
                                                    })
                                                }
                                            </Row>
                                        </Tab.Pane>
                                        <Tab.Pane eventKey={"soft"}> </Tab.Pane>
                                    </Tab.Content>
                                </Col>
                            </Tab.Container>
                        </div>
                    </Col>

                </Row>
            </Container>
        </section>
    );
}
export default Skills;
